import React from "react";
import { makeStyles } from '@material-ui/core/styles'
import { SideBarData } from "./SideBarData";
import { hover } from "@testing-library/user-event/dist/hover";
import "../SideBarComponents/SideBarCss.css";
import { Link } from "react-router-dom";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import DashBoard from "../SideBarPages/DashBoard";
import Accounts from '../SideBarPages/Accounts';
import Materials from '../SideBarPages/Materials';
import Components from '../SideBarPages/Components';
import Products from '../SideBarPages/Products';

function CustomSideBar() {
    // const classess = StyledSideBar()
    return (
        <div className="side">
            <ul className="sidebarList">
                {SideBarData.map((val, key) => {
                    return <li
                        key={key}
                        className="row"
                        id={window.location.pathname == val.path ? "active" : ""}
                    // onClick={()=> {
                    //     window.location.pathname = val.link;

                    //     }}
                    >
                        <Link to={val.path}>Hiiii</Link>
                        <div>{val.title}</div></li>
                })}
            </ul>
        </div>
    )
}

export default CustomSideBar
